ResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'SequenceNumber'), pyxb.binding.datatypes.integer, scope=ResourceGroupContentItem, documentation='The number indicating the order of the ddex:ContentItem among all ddex:Resources within this ddex:ResourceGroup. This is analogous to the ddex:Track number on a ddex:SoundCarrier. Not all ddex:ResourceGroups necessarily have ddex:SequenceNumbers (it is most applicable to ddex:SoundRecordings and ddex:MusicalWorkVideos). The ddex:SequenceNumber is unique within its ddex:ResourceGroupLevelNumber.', location=pyxb.utils.utility.Location('http://ddex.net/xml/20121219/ddexC.xsd', 3829, 9)))

ResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'SequenceSubNumber'), pyxb.binding.datatypes.integer, scope=ResourceGroupContentItem, documentation='The ddex:SequenceNumber within the ddex:SequenceNumber. Example: if a ddex:Track is subdivided into several numbered sections, these are numbered with a ddex:SequenceSubNumber. The ddex:SequenceSubNumber is unique within its ddex:SequenceNumber.', location=pyxb.utils.utility.Location('http://ddex.net/xml/20121219/ddexC.xsd', 3834, 9)))

ResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'ResourceType'), ResourceType, scope=ResourceGroupContentItem, documentation='A ddex:Composite containing details of the ddex:Type of the ddex:ContentItem.', location=pyxb.utils.utility.Location('http://ddex.net/xml/20121219/ddexC.xsd', 3839, 9)))

ResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'ReleaseResourceReference'), ReleaseResourceReference, scope=ResourceGroupContentItem, documentation='A ddex:Composite containing a ddex:ReleaseResourceReference for the ddex:ContentItem (specific to this ddex:Message). The ddex:LocalAnchorReference in this ddex:Composite is a xs:string starting with the letter A.', location=pyxb.utils.utility.Location('http://ddex.net/xml/20121219/ddexC.xsd', 3845, 9)))

ResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'LinkedReleaseResourceReference'), LinkedReleaseResourceReference, scope=ResourceGroupContentItem, documentation='A ddex:Composite containing details of a ddex:ReleaseResourceReference (specific to this ddex:Message) for a ddex:Resource which is linked to this ddex:ContentItem. Example: an ddex:Image, ddex:Text or ddex:NonMusicalWorkVideo associated with a ddex:SoundRecording. This ddex:LocalAnchorReference is a xs:string starting with the letter A.', location=pyxb.utils.utility.Location('http://ddex.net/xml/20121219/ddexC.xsd', 3850, 9)))

ResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'ResourceGroupContentItemReleaseReference'), STD_ANON_10, scope=ResourceGroupContentItem, documentation='The ddex:Identifier (specific to the ddex:Message) of a ddex:Release which has the same content as the ern:ResourceGroupContentItem. This is a ddex:LocalReleaseAnchorReference starting with the letter R.', location=pyxb.utils.utility.Location('http://ddex.net/xml/20121219/ddexC.xsd', 3857, 12)))

ResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'ReleaseId'), ReleaseId, scope=ResourceGroupContentItem, documentation='A ddex:Composite containing details of ddex:ReleaseIds of a ddex:Release which has the same content as the ern:ResourceGroupContentItem. If available, a ddex:GRid has to be used. If the ddex:Release contains only one ddex:SoundRecording, the ddex:ISRC of the ddex:SoundRecording may be used instead. If the ddex:Release is an abstraction of a complete ddex:PhysicalProduct (such as a CD ddex:Album), the ddex:ICPN of the ddex:PhysicalProduct may be used instead.', location=pyxb.utils.utility.Location('http://ddex.net/xml/20121219/ddexC.xsd', 3867, 12)))

ResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'Duration'), pyxb.binding.datatypes.duration, scope=ResourceGroupContentItem, documentation='The ddex:Duration of the ddex:ContentItem featured, if it is a ddex:SoundRecording or ddex:Video (using the ISO 8601:2004 PT[[hhH]mmM]ssS format, where lower case characters indicate variables, upper case characters are part of the xs:string, e.g. one hour, two minutes and three seconds would be PT1H2M3S). This ddex:Duration may be less than the normal ddex:Duration of the ddex:ContentItem, if only a part of it is included.', location=pyxb.utils.utility.Location('http://ddex.net/xml/20121219/ddexC.xsd', 3873, 9)))

ResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'IsHiddenResource'), pyxb.binding.datatypes.boolean, scope=ResourceGroupContentItem, documentation='The ddex:Flag indicating whether a ddex:Resource in a ddex:Release is hidden in some way from the ddex:Consumer (=True) or not (=False).', location=pyxb.utils.utility.Location('http://ddex.net/xml/20121219/ddexC.xsd', 3878, 9)))

ResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'IsBonusResource'), pyxb.binding.datatypes.boolean, scope=ResourceGroupContentItem, documentation='The ddex:Flag indicating whether a ddex:Resource in a ddex:Release is additional to those on the original ddex:Release of which this is a ddex:Version (=True) or not (=False).', location=pyxb.utils.utility.Location('http://ddex.net/xml/20121219/ddexC.xsd', 3883, 9)))

